                    </div> 
                    </li> ):
                    (
                        <Link to='/login'>Login</Link>
                    )}
                    <li>
                        <Link>
                            Cart  {}
                        </Link>
                    </li>
                </ul>
            </nav>
        </div>
    </header>
  )
}

export default Header
